import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button ,Container,Row,Col } from 'react-bootstrap';
import Image from './Comp/Image';
<link rel="stylesheet" href="" />

function App() {
  return (
    <div >
      <Container>
      <Row>
        <Col xs lg ={4} md={4} id='zunair'>
          <div className="App">

        <Image/>
          </div>
        <br />
        <div className="App">

        <h4 id='name'>Zunair Khan</h4>
        <p id='zunn'>Web and App Developer</p>
        </div>

        <div id='bord'>

        </div>
        <br />
        <div className='container'>

        <h5 id='contact'>CONTACT INFO</h5>
        </div>
          </Col>
        <Col>
       <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Possimus assumenda laborum ullam sed animi obcaecati ipsam vitae aperiam itaque tenetur, sequi perferendis. Autem exercitationem consectetur eos maiores nihil praesentium facilis!</p>
        </Col>
      </Row>

    </Container>
    </div>
  );
}

export default App;
